import React from 'react';
function About(){
  return (
    <div>
      <h2>About Auction App</h2>
      <p>
        Our Auction App provides a platform for users to buy and sell items through bidding.
        It ensures transparency, fair bidding, and a user-friendly experience.
      </p>
    </div>
  );
}

export default About;
